import React from 'react'
import avatar from './avatar';
import './nav.css';

function Navbar() {
  return (
    <div className='nav'>
       <img
        className='nav_logo'
        src='https://upload.wikimedia.org/wikipedia/commons/0/08/Netflix_2015_logo.svg'
        alt='nav_logo'
       />
       <img
        className='avatar_logo'
        src='avatar.jpg'
        alt='avatar_logo'
       />
    </div>
  )
}

export default Navbar
